INSERT INTO `wp_posts` VALUES (5,1,'2016-10-01 17:12:52','2016-10-01 17:12:52','','pahadi-dagdiya-logo','','inherit','open','closed','','pahadi-dagdiya-logo','','','2016-10-01 17:13:16','2016-10-01 17:13:16','',0,'http://localhost/wp-content/uploads/2016/10/Pahadi-Dagdiya-logo.png',0,'attachment','image/png',0),(6,1,'2016-10-01 17:54:18','2016-10-01 17:54:18','[gallery ids=\"645,644,632,630,629,631,633,634,635,636,637,638,639,641,642,643\"]\r\n\r\nPahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tuition Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','publish','closed','closed','','welcome-to-pahadi-dagrya-group','','','2017-01-08 08:13:33','2017-01-08 02:43:33','',0,'http://localhost/?page_id=6',0,'page','',0),(7,1,'2016-10-01 17:54:18','2016-10-01 17:54:18','<p class=\"pad_bot2\"><strong>At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa.</strong></p>\r\n<p style=\"text-align: left;\">Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis.</p>','Welcome to Pahadi Dagrya group','','inherit','closed','closed','','6-revision-v1','','','2016-10-01 17:54:18','2016-10-01 17:54:18','',6,'http://localhost/2016/10/01/6-revision-v1/',0,'revision','',0),(8,1,'2016-10-01 18:01:08','2016-10-01 18:01:08','','HOME','','publish','closed','closed','','8','','','2016-10-01 23:56:14','2016-10-01 23:56:14','',0,'http://localhost/?p=8',1,'nav_menu_item','',0),(11,1,'2016-10-01 18:14:14','2016-10-01 18:14:14','','fake_brick','','inherit','open','closed','','fake_brick','','','2016-10-01 18:14:14','2016-10-01 18:14:14','',0,'http://localhost/wp-content/uploads/2016/10/fake_brick-1.png',0,'attachment','image/png',0),(12,1,'2016-10-01 18:21:11','2016-10-01 18:21:11','','cork_1','','inherit','open','closed','','cork_1','','','2016-10-01 18:21:11','2016-10-01 18:21:11','',0,'http://localhost/wp-content/uploads/2016/10/cork_1.png',0,'attachment','image/png',0),(13,1,'2016-10-01 18:23:27','2016-10-01 18:23:27','','leather_1','','inherit','open','closed','','leather_1','','','2016-10-01 18:23:27','2016-10-01 18:23:27','',0,'http://localhost/wp-content/uploads/2016/10/leather_1.png',0,'attachment','image/png',0),(14,1,'2016-10-01 19:11:11','2016-10-01 19:11:11','','header_image','','inherit','open','closed','','header_image','','','2016-10-01 19:11:11','2016-10-01 19:11:11','',0,'http://localhost/wp-content/uploads/2016/10/header_image.jpg',0,'attachment','image/jpeg',0),(15,1,'2016-10-01 19:14:17','2016-10-01 19:14:17','','header_image','','inherit','open','closed','','header_image-2','','','2016-10-01 19:14:17','2016-10-01 19:14:17','',0,'http://localhost/wp-content/uploads/2016/10/header_image-1.jpg',0,'attachment','image/jpeg',0),(16,1,'2016-10-01 19:42:46','2016-10-01 19:42:46','We believe that education is the key to the development of any child, region and country. To enssure that Uttarakhand\'s educational aspirations are met we at Pahadi Dagdya work tirelessly towards:\r\n1. Providing all support to aide education amongst kids of all age groups in Uttarakhand. We do this by providing them with Fees, Bags, Books, Uniforms amongst other tools required for pursuing education at school.\r\n2. Providing financial aid to kids who are economically deprived and are not being able to pursue education as a result.\r\n3. Identifying school drop outs, motivating them and ensuring their re-admission in school.','Our Mission','','publish','closed','closed','','our-mission','','','2016-10-17 17:32:36','2016-10-17 17:32:36','',0,'http://localhost/?page_id=16',0,'page','',0),(17,1,'2016-10-01 19:37:55','2016-10-01 19:37:55','','13612151_790688251033307_6929257105206545597_n','','inherit','open','closed','','13612151_790688251033307_6929257105206545597_n','','','2016-10-01 19:37:55','2016-10-01 19:37:55','',16,'http://localhost/wp-content/uploads/2016/10/13612151_790688251033307_6929257105206545597_n.jpg',0,'attachment','image/jpeg',0),(19,1,'2016-10-01 19:42:46','2016-10-01 19:42:46','<img class=\"alignleft wp-image-17 size-medium\" src=\"http://localhost/wp-content/uploads/2016/10/13612151_790688251033307_6929257105206545597_n-300x225.jpg\" alt=\"13612151_790688251033307_6929257105206545597_n\" width=\"300\" height=\"225\" />\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incid- idunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exerci- tation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse.\r\n\r\nLorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incid- idunt ut labore et dolore magna aliqua. Ut enim ad minim v