think that one soul is connected with another soul. Suppose you all sit here, without having any connection with one another. In that case, you cannot call it a society. It is like a heap of pebbles on the road which look connected with each other, but are not really so. In fact, society does not mean merely a group of people. Society is the relationship between individuals, and not merely a group of people. There is a difference between a group of people and society, though on the surface it appears that society is nothing but a group of people.\r\n\r\n<img class=\"ngg_displayed_gallery mceItem\" src=\"http://pahadidagdya.com/nextgen-attach_to_post/preview/id--108\" data-mce-placeholder=\"1\" />','Achievements','','inherit','closed','closed','','106-revision-v1','','','2016-10-03 17:40:09','2016-10-03 17:40:09','',106,'http://pahadidagdya.com/?p=349',0,'revision','',0),(350,1,'2016-10-03 17:45:15','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2016-10-03 17:45:15','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=350',0,'ngg_gallery','',0),(351,1,'2016-10-03 17:46:14','0000-00-00 00:00:00','','Untitled displayed_gallery','','draft','closed','closed','','','','','2016-10-03 17:46:14','0000-00-00 00:00:00','',0,'http://pahadidagdya.com/?p=351',0,'displayed_gallery','',0),(352,1,'2016-10-03 17:47:25','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_table_extras','','','2016-10-03 17:47:25','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9',0,'http://pahadidagdya.com/?p=352',0,'ngg_gallery','',0),(353,1,'2016-10-03 17:47:27','0000-00-00 00:00:00','eyJpZF9maWVsZCI6IklEIiwiX19kZWZhdWx0c19zZXQiOnRydWV9','Untitled ngg_gallery','','draft','closed','closed','','mixin_nextgen_tab