 Bhelasain\r\n2 from GIC Bagwadi\r\n6 from GHS Palan\r\n\r\n<img class=\"ngg_displayed_gallery mceItem\" src=\"http://pahadidagdya.com/nextgen-attach_to_post/preview/id--108\" data-mce-placeholder=\"1\" />','Achievements','','inherit','closed','closed','','106-revision-v1','','','2016-10-17 17:30:51','2016-10-17 17:30:51','',106,'http://pahadidagdya.com/?p=549',0,'revision','',0),(550,1,'2016-10-17 17:31:16','2016-10-17 17:31:16','So far we have reached out 11 schools and 49 children\r\n9 From Inter College Jakheti\r\n3 from GHS Dungri\r\n3 from GHS Salt Mhadev\r\n6 from GIC Khirekhal\r\n4 from Inter College Adalikhal\r\n3 from Public High School Lachi\r\n5 From GHS Anthwal Gaon\r\n6 from Inter College Jogimarhi\r\n2 from GHS Bhelasain\r\n2 from GIC Bagwadi\r\n6 from GHS Palan\r\n\r\n<img class=\"ngg_displayed_gallery mceItem\" src=\"http://pahadidagdya.com/nextgen-attach_to_post/preview/id--108\" data-mce-placeholder=\"1\" />','Achievements','','inherit','closed','closed','','106-revision-v1','','','2016-10-17 17:31:16','2016-10-17 17:31:16','',106,'http://pahadidagdya.com/?p=550',0,'revision','',0),(551,1,'2016-10-17 17:32:36','2016-10-17 17:32:36','We believe that education is the key to the development of any child, region and country. To enssure that Uttarakhand\'s educational aspirations are met we at Pahadi Dagdya work tirelessly towards:\r\n1. Providing all support to aide education amongst kids of all age groups in Uttarakhand. We do this by providing them with Fees, Bags, Books, Uniforms amongst other tools required for pursuing education at school.\r\n2. Providing financial aid to kids who are economically deprived and are not being able to pursue education as a result.\r\n3. Identifying school drop outs, motivating them and ensuring their re-admission in school.','Our Mission','','inherit','closed','closed','','16-revision-v1','','','2016-10-17 17:32:36','2016-10-17 17:32:36','',16,'http://pahadidagdya.com/?p=551',0,'revision','',0),(552,1,'2016-10-17 17:34:27','2016-10-17 17:34:27','Pahadi Dagdya is an organization that finds its roots in the beautiful &amp; serene mountains of Uttarakhand. What was started by 4 friends as a voluntary effort to help the economically deprived children of our homeland, is today a not-for-profit organization that is joined by 127 people who share the vision to provide support to these kids. We believe that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tution Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagrya group','','inherit','closed','closed','','6-revision-v1','','','2016-10-17 17:34:27','2016-10-17 17:34:27','',6,'http://pahadidagdya.com/?p=552',0,'revision','',0),(553,1,'2016-10-17 17:36:52','2016-10-17 17:36:52','Pahadi Dagdya has reached 11 schools in Uttarakhand and helped 49 economically deprived kids by providing them aid for education. These are the number of students we have helped in different areas of Uttarakhand.\r\n\r\n<strong>MakeÂ Donation :-</strong>Â We ourselves feel that what we are doing is just a drop in the ocean. But if that drop was not in the ocean, I think the ocean would be less because of that missing drop. I do not agree with the big way of doing things.\r\n\r\nPlease charity, details are below.\r\nSapna Lakhera, Corporation Bank,\r\nGhitorni Branch, New Delhi,\r\nAccount No. 176000101002493,\r\nIFSC code CORP0001770\r\n\r\n&nbsp;\r\n\r\n<strong>Join Volunteer:-</strong>\r\n\r\nâThe best way to find yourself Is to lose yourself in the service of others.\"\r\nso join us as a volunteer.\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nb