lieve that every child has the right to seek education and if he or she finds hindrance in doing so we at Pahadi Dagdya are there to help those kids by providing them with Books, Paying their Tution Fee, Providing them with uniform and shoes. Our aim is to overcome all obstacles that come in the way of these kids and their development. Pahadi Dagdya means friend from the Hills, and just like any good friend we offer support of every kind to ensure the growth &amp; development of our tiny little friends.','Welcome to Pahadi Dagdya group','','inherit','closed','closed','','6-revision-v1','','','2017-01-08 06:56:27','2017-01-08 01:26:27','',6,'http://pahadidagdya.com/?p=623',0,'revision','',0),(624,1,'2017-01-08 06:57:13','2017-01-08 01:27:13','<img class=\"alignnone size-medium wp-image-619\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/d77d9146-ab51-4cb0-b955-dc5162df955a-300x300.jpg\" alt=\"\" width=\"300\" height=\"300\">\r\n\r\n<img class=\"alignnone size-medium wp-image-618\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/14495339_840017876100344_991024516638777790_n-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\">\r\n\r\n<img class=\"alignnone size-medium wp-image-617\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/14495339_840017876100344_991024516638777790_n-1-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\">\r\n\r\n<img class=\"alignnone size-medium wp-image-616\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/14479782_840018276100304_1889606925295371916_n-225x300.jpg\" alt=\"\" width=\"225\" height=\"300\">\r\n\r\n<img class=\"alignnone size-medium wp-image-615\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/14479733_840018519433613_991315326489804375_n-300x225.jpg\" alt=\"\" width=\"300\" height=\"225\">\r\n\r\n<img class=\"alignnone size-medium wp-image-614\" src=\"http://pahadidagdya.com/wp-content/uploads/2017/01/14479570_840018072766991_1719056780885723397_n-300x225.jpg\" alt=\"\" width=\"300\